def get_header_array doc
  retval = {}
  doc.xpath('//ns:Field').each do |node|

    uid = node['uid']
    type = node['type']
    name = node.content.strip

    # Incremental print that I'll comment out later.
    #puts "'#{node.text.strip}' maps to #{uid}"

    # Ordered array of pairs of values
    retval[uid] = [name, type]
    #a << node.content.split
    #puts "boo"
  end

  retval
end

def print_header header_array
  # it is dumb that we have to do this much work to get tabs to print nicely.
  header_array.each_with_index do |pair, index|
    if index == (header_array.length-1) then
      print "#{pair[1][0]}"
    else
      print "#{pair[1][0]}\t"
    end
  end
  puts
end


