doc.xpath('//ns:Items//ns:Item').each do |node|
  catalogId = node['id']

  puts catalogId + "\t"


  node.children.each do |element|
    if element.keys != []
      uid = element['uid']
      element_metadata = header_array[uid]
      element_name = element_metadata[0]
      element_type = element_metadata[1]
      if element_type == "0" || element_type == "2"
        element_payload = element.content

      elsif element_type == "7" || element_type == "1" # color mode
        element_payload = element.content.strip


      else
        element_payload = element['displayValue']
      end
      # Kept:
      #  0 - default (text?)
      #  1 - boolean
      #  2 - long int
      #  4 - date (poss. extract seconds since 1970?)
      # discarded:
      #  5 - is internal asset reference
      #  6 - is thumbnail data
      #  7 - is thumbnail rotation
      #  9 - is asset data size (long)
      if element_payload != nil
        puts (" #{element_name}: #{element_payload}")
        # else
        #   puts ("  #{element_name}[#{element_type}]:***************************************")
      end


    end


  end
  print " ------- "


end

